import React from "react";

export default function NoteTimeline(props){

  const displayNotes = (props) => {
    const {menu, notes} = props;

    if (notes.length > 0) {
      return(
        notes.map((note, index) => {
          console.log(note);
          return(
            <div className='note' key={note._id}>
              <h3 className="note__title">{note.Name}</h3>
              <p className="note__body">{note.Recognition}</p>
              <p className="note__body">{note.Address}</p>
              <p className="note__body">{note.CurrentRatings}</p>
              <span className="note__fadeOut"></span>
            </div>
          )
        })
      )
    } else {
      return (<h3>No colleges yet.</h3>)
    }
    }
    return(
      <>
        {displayNotes(props)}
      </>
    )
  }
